The @classType annotation links a class to its type definition, which is used for registering properties and signals. <class local> refers to the local to which your @class annotation is attached. For example: --- @class
local MyClass = {} --- @classType MyClass
export type MyClass = RefCounted & typeof(MyClass) & { -- Attach annotations in the "Class type" section here. tableField1: number, tableField2: string,
} & { -- It's okay to intersect multiple table types. -- Annotations will still be parsed. tableField3: Vector2,
} -- <truncated> Only plain table types and intersections (&, not |) are supported.
